import React from "react";
import { Link } from "react-router-dom";

const ProductPage = () => {
  return (
    <div>
      <h2>Some of the product</h2>
      <p>
        Go to <Link to="/product">the list of product</Link>.
      </p>
    </div>
  );
};

export default ProductPage;
